type ThreeDProps = {
  url: string
}
export class ThreeD extends Component<ThreeDProps> {
  render() {
    return (
      <>
        <div className="sketchfab-embed-wrapper">
          <iframe title="A 3D model" width="100%" src={this.props.url} frameBorder="0" allow="autoplay; fullscreen; vr"></iframe>
        </div>
      </>
    )
  }
}
